--
-- Name: to_days(timestamp with time zone); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION to_days(i timestamp with time zone) RETURNS integer
    LANGUAGE plpgsql
    AS $$
    BEGIN
      RETURN (make_date((extract(year from i) :: int), (extract(month from i) :: int), (extract(day from i) :: int)) - date '0001-01-01') + 365;
    END;
    $$;


